"""### Model 2: Classification Model (with callbacks)
* We will be using Sequential API to build the model
  * Input: 9
  * Dense Layers: 4
  * Nodes in Hidden Layer 1: 1000
  * Nodes in Hidden Layer 2: 500
  * Nodes in Hidden Layer 3: 250
  * Nodes in Hidden Layer 3: 100
* We use the Dropout function with 0.2 probability
* Compile the Model using
  * Optimizer: Adam
  * Loss function: binary_crossentropy
  * Additional Metrics: Accuracy

* We will make a new variable called 'history' to evaluate the learning curves. 
  * epochs of 5000
  * batch size of 50
* We will also use EarlyStopping callbacks to prevent overfitting with a patience of 50
* Activation functions used:
  * relu
  * sigmoid

* Trainable Parameters
  * The model calculates the trainable parameters using input, hidden and output nodes, and biases on input and hidden nodes.
  * Dropouts will not have any trainable parameters
  * Total number of Trainable parameters are: 660,9511


"""

# early stopping callback
# We will use EarlyStopping callbacks to prevent overfitting with a patience of 50

es = EarlyStopping(monitor='val_accuracy', 
                                   mode='max', # maximize the accuracy!
                                   patience=50,
                                   restore_best_weights=True)

# now we just update our model fit call
history = model.fit(X_train, y_train,
                    validation_data = (X_test, y_test),
                    callbacks=[es],
                    epochs=5000,
                    batch_size=50,
                    verbose=1)

